import React from 'react';

const TestCard = ({test}) => {

    return (
        <div className="col-6">
            <form>
                <div className="m-2">
                    <p>{test?.question}</p>
                    {test?.answers?.map( it => <input type="checkbox" name={it}></input> )}
                </div>
            </form>
        </div>
    )
}

export default TestCard;
